const admin = [
  {
    title: "title",
    urlToImage:
      "https://staticg.sportskeeda.com/editor/2021/11/caca5-16370851386444-1920.jpg",
    description: "description",
    author: "author",
    content: "content",
  },
  {
    title: "title",
    urlToImage:
      "https://staticg.sportskeeda.com/editor/2021/11/caca5-16370851386444-1920.jpg",
    description: "description",
    author: "author",
    content: "content",
  },
];
const AdminDashboard = ({ tech }) => {
  return (
    <div className="admin">
      <div className="admin_top">Admin Headers</div>

      <div className="admin_main">
        <div className="admin_sidebar">
          <AdminSidebar />
        </div>
        <div className="admin_body">
          <PerformanceChart />
          <div className="admin_status">
            <div className="admin_status1">

            </div>
            <div className="admin_status1">total page views</div>
          </div>
        </div>

        <div className="admin_users">admin user</div>
      </div>
    </div>
  );
};

export default AdminDashboard;
